import React from 'react';

// CSS Styles
const styles = {
  container: {
    padding: '4rem',
    backgroundColor: '#f5f5f5',
  },
  innerContainer: {
    maxWidth: '1200px',
    margin: '0 auto',
  },
  sectionTitle: {
    textAlign: 'center',
    fontSize: '2.5rem',
    fontWeight: '700',
    marginBottom: '3rem',
    color: '#333',
  },
  section: {
    padding: '2rem',
    backgroundColor: '#ffffff',
    borderRadius: '12px',
    boxShadow: '0px 6px 15px rgba(0, 0, 0, 0.1)',
    marginBottom: '2rem',
    textAlign: 'center',
    maxWidth: '300px',
    margin: '1rem auto',
  },
  sectionTitleStyle: {
    fontSize: '1.8rem',
    fontWeight: '600',
    marginBottom: '1.5rem',
    color: '#007396', // Java-like theme color for section titles
  },
  badgeContainer: {
    display: 'flex',
    flexWrap: 'wrap',
    justifyContent: 'center',
    gap: '10px',
  },
  badgeStyle: {
    margin: '5px',
    display: 'inline-block',
  },
};

// Section Component
const Section = ({ title, items }) => (
  <div style={styles.section}>
    <h3 style={styles.sectionTitleStyle}>{title}</h3>
    <div style={styles.badgeContainer}>
      {items.map(({ name, badgeUrl }) => (
        <img key={name} src={badgeUrl} alt={name} style={styles.badgeStyle} />
      ))}
    </div>
  </div>
);

// Main Skills Component
const Skills = () => (
  <section style={styles.container} id="Skills">
    <div style={styles.innerContainer}>
      <h2 style={styles.sectionTitle}>My Skills</h2>

      {/* Existing Sections */}
      <div style={styles.badgeContainer}>
        <Section
          title="Frontend"
          items={[
            { name: 'JavaScript', badgeUrl: 'https://img.shields.io/badge/-JavaScript-F7DF1E?style=flat&logo=javascript&logoColor=black' },
            { name: 'HTML5', badgeUrl: 'https://img.shields.io/badge/-HTML5-E34F26?style=flat&logo=html5&logoColor=white' },
            { name: 'CSS3', badgeUrl: 'https://img.shields.io/badge/-CSS3-1572B6?style=flat&logo=css3&logoColor=white' },
            { name: 'React', badgeUrl: 'https://img.shields.io/badge/-React-61DAFB?style=flat&logo=react&logoColor=black' },
          ]}
        />
        <Section
          title="Backend"
          items={[
            { name: 'Java', badgeUrl: 'https://img.shields.io/badge/-Java-007396?style=flat&logo=java&logoColor=white' },
            { name: 'Node.js', badgeUrl: 'https://img.shields.io/badge/-Node.js-339933?style=flat&logo=node.js&logoColor=white' },
            { name: 'C#', badgeUrl: 'https://img.shields.io/badge/-CSharp-239120?style=flat&logo=c-sharp&logoColor=white' },
            { name: 'C++', badgeUrl: 'https://img.shields.io/badge/-C++-00599C?style=flat&logo=c%2B%2B&logoColor=white' },
          ]}
        />
        <Section
          title="MERN Stack"
          items={[
            { name: 'MongoDB', badgeUrl: 'https://img.shields.io/badge/-MongoDB-47A248?style=flat&logo=mongodb&logoColor=white' },
            { name: 'Express.js', badgeUrl: 'https://img.shields.io/badge/-Express.js-000000?style=flat&logo=express&logoColor=white' },
            { name: 'React', badgeUrl: 'https://img.shields.io/badge/-React-61DAFB?style=flat&logo=react&logoColor=black' },
            { name: 'Node.js', badgeUrl: 'https://img.shields.io/badge/-Node.js-339933?style=flat&logo=node.js&logoColor=white' },
          ]}
        />
        <Section
          title="Testing"
          items={[
            { name: 'Selenium', badgeUrl: 'https://img.shields.io/badge/-Selenium-43B02A?style=flat&logo=selenium&logoColor=white' },
            { name: 'JUnit', badgeUrl: 'https://img.shields.io/badge/-JUnit-25A162?style=flat&logo=junit5&logoColor=white' },
          ]}
        />
        <Section
          title="Tools & Platforms"
          items={[
            { name: 'Git', badgeUrl: 'https://img.shields.io/badge/-Git-F05032?style=flat&logo=git&logoColor=white' },
            { name: 'GitHub', badgeUrl: 'https://img.shields.io/badge/-GitHub-181717?style=flat&logo=github&logoColor=white' },
            { name: 'Docker', badgeUrl: 'https://img.shields.io/badge/-Docker-2496ED?style=flat&logo=docker&logoColor=white' },
            { name: 'Visual Studio Code', badgeUrl: 'https://img.shields.io/badge/-Visual_Studio_Code-007ACC?style=flat&logo=visual-studio-code&logoColor=white' },
          ]}
        />
        <Section
          title="Database"
          items={[
            { name: 'MySQL', badgeUrl: 'https://img.shields.io/badge/-MySQL-4479A1?style=flat&logo=mysql&logoColor=white' },
            { name: 'PostgreSQL', badgeUrl: 'https://img.shields.io/badge/-PostgreSQL-336791?style=flat&logo=postgresql&logoColor=white' },
            { name: 'NoSQL', badgeUrl: 'https://img.shields.io/badge/-NoSQL-F26522?style=flat&logo=mongodb&logoColor=white' },
          ]}
        />
        <Section
          title="Cloud & DevOps"
          items={[
            { name: 'AWS', badgeUrl: 'https://img.shields.io/badge/-AWS-232F3E?style=flat&logo=amazon-aws&logoColor=white' },
            { name: 'Azure', badgeUrl: 'https://img.shields.io/badge/-Azure-0078D4?style=flat&logo=microsoft-azure&logoColor=white' },
            { name: 'Jenkins', badgeUrl: 'https://img.shields.io/badge/-Jenkins-D24939?style=flat&logo=jenkins&logoColor=white' },
          ]}
        />
      </div>

      {/* New Sections */}
      <div style={styles.badgeContainer}>
        <Section
          title="Data Structures"
          items={[
            { name: 'Arrays', badgeUrl: 'https://img.shields.io/badge/-Arrays-007396?style=flat&logo=data&logoColor=white' },
            { name: 'Linked Lists', badgeUrl: 'https://img.shields.io/badge/-Linked_Lists-007396?style=flat&logo=data&logoColor=white' },
            { name: 'Stacks', badgeUrl: 'https://img.shields.io/badge/-Stacks-007396?style=flat&logo=data&logoColor=white' },
            { name: 'Queues', badgeUrl: 'https://img.shields.io/badge/-Queues-007396?style=flat&logo=data&logoColor=white' },
            { name: 'Trees', badgeUrl: 'https://img.shields.io/badge/-Trees-007396?style=flat&logo=data&logoColor=white' },
            { name: 'Graphs', badgeUrl: 'https://img.shields.io/badge/-Graphs-007396?style=flat&logo=data&logoColor=white' }
          ]}
        />
        <Section
          title="Operating Systems"
          items={[
            { name: 'Linux', badgeUrl: 'https://img.shields.io/badge/-Linux-007396?style=flat&logo=linux&logoColor=white' },
            { name: 'Unix', badgeUrl: 'https://img.shields.io/badge/-Unix-007396?style=flat&logo=unix&logoColor=white' },
            { name: 'Windows', badgeUrl: 'https://img.shields.io/badge/-Windows-007396?style=flat&logo=windows&logoColor=white' },
            { name: 'Unix Shell Scripting', badgeUrl: 'https://img.shields.io/badge/-Shell_Scripting-007396?style=flat&logo=unix&logoColor=white' },
          ]}
        />
      </div>
    </div>
  </section>
);

export default Skills;
